import React from "react";
import {Text,View,TextInput,StyleSheet} from "react-native";

export default function Calculate ()
{
    return(
        <View style = {styles.poles}> 
            {/* 5 окошек */}
            <TextInput style = {styles.textPole} placeholder = 'Вводить Q'/> 
            <TextInput style = {styles.textPole} placeholder = 'Вводить c'/> 
            <TextInput style = {styles.textPole} placeholder = 'Вводить m'/> 
            <TextInput placeholder = 'Вводить T1'/> 
            <TextInput placeholder = 'Вводить T2'/> 
        </View>
    )  
};
 const styles = StyleSheet.create(
     {
        poles:
        {
            color:'black',
        },
     }
 )
